-- 테스트용 데이터입니다
-- 부모 카테고리 5개에 각각 자식 카테고리 5개 총 자식카테고리 25개가 존재합니다
-- 자식 카테고리들은 각각 400의 상품, 즉 총 10000개의 상품이 존재합니다
-- 브랜드는 50개가 존재하고 브랜드당 200개의 상품을 가지고 있습니다
-- 상품 데이터 넣을떄 브랜드가 균등하게 군집되도록 상품을 넣어기때문에 모든 자식 카테고리는 모든 브랜드의 상품을 하나씩 가질수 밖에 없습니다
-- 카테고리 ID가 6인 상품들에 대해 일괄적으로 브랜드를 1번으로 통일했습니다


























